  return (
    <div className='Header'>
      <div className='container-icon'>

      </div>
      <div className='container-auth'></div>
      <div className = 'container-add-post'>
        <Button variant="outline-dark" className = 'button-add-post '><Link className='link-post' to ='/posts'>Додати оголошення</Link></Button>
      </div>
    </div>
  );
}

export default Header;
